Debbie Goes To Hawaii [Classic 1988][DvdRip]

An Erotic Excursion to Paradise
Oh that Debbie! She gets into enough trouble on land. See what happens in the air on her first flight as a stewardess! First, Debbie (Alicia Monet) gets a relaxing massage from a hunky masseur. Soon, Nina Hartley and Rene Morgan join the fun and everyone gets rubbed the right way! Then on her flight, many outrageous sexcapades unfold with the horny passengers. And if that weren't enough, once in Honolulu, Debbie and alluring Angel Kelly make sure two studs get lei'd Hawaiian style! It's and &quot;aloha&quot; they won't soon forget!

